<script setup lang="ts">
import gsap from 'gsap'
import { MotionPathPlugin } from 'gsap/MotionPathPlugin'
const { $app } = useNuxtApp()

type TSide = '.left-side' | '.right-side' | '.left-col' | '.right-col' | '.alone-col'
type TCoin = 'tether' | 'satoshi'

const SPEED = 50
const motionPathFrom = reactive({})
const motionPathTo = reactive({})

const paths = ['.left-side', '.right-side', '.left-col', '.right-col', '.alone-col']
const icons = ['.btc-icon', '.tether-icon', '.btc-icon-col', '.tether-icon-col', '.tether-alone']

onMounted(() => {
  paths.forEach((path, index) => {
    const iconElements = document.querySelectorAll(icons[index])
    drawMotionPath(path, iconElements, duration(path, SPEED), delay(path, iconElements.length, SPEED))
  })
})
onUnmounted(() => {
  Object.values(motionPathTo).forEach((motion) => motion.kill())
  Object.values(motionPathFrom).forEach((motion) => motion.kill())
})
function duration(path: string, speed: number): number {
  return MotionPathPlugin.getLength(path) / speed
}

function delay(path: string, pcs: number, speed: number): number {
  return MotionPathPlugin.getLength(path) / pcs / speed
}

function motionPath(sideClass: TSide) {
  return {
    path: sideClass,
    align: sideClass,
    alignOrigin: [0.5, 0.5],
    autoRotate: false,
    start: 1,
    end: 0,
  }
}

function drawMotionPath(pathClass: TSide, iconElements: NodeListOf<Element>, duration = 4, delay = null) {
  gsap.registerPlugin(MotionPathPlugin)
  iconElements.forEach((icon, index) => {
    const uniqueIndex = `${pathClass}-${index}`

    motionPathFrom[uniqueIndex] = gsap.from(icon, { opacity: 0, duration: 1, delay: duration })
    motionPathTo[uniqueIndex] = gsap.to(icon, {
      motionPath: motionPath(pathClass),
      transformOrigin: '50% 50%',
      duration,
      repeat: -1,
      delay: delay ? delay * (index + 1) : 0,
      ease: 'none',
      onRepeat: () => {
        if (pathClass == '.right-side') {
          countBalance('tether')
        }
        if (pathClass == '.left-side') {
          countBalance('satoshi')
        }
      },
    })
  })
}

const texts = ref()

const next = 3 // time to change

onMounted(() => {
  texts.value = gsap.utils.toArray('.text')
  crossfade()
})

const crossfadeAnimation = ref()
function crossfade() {
  gsap.timeline().to(texts.value, { duration: 1, y: '-=36' }).to(texts.value[0], { y: '+=216', duration: 0 }) // the first to the end

  texts.value.push(texts.value.shift()) // the first (shift) to the end (push) from the array
  // start endless run

  crossfadeAnimation.value = gsap.delayedCall(next, crossfade)
}

const totalBalance = reactive({ tether: 2500, satoshi: 2500 })
const TETHER_PROPERTIES = {
  DIGIT_WIDTH: 12,
  BALANCE_START_X: 510,
}
const SATOSHI_PROPERTIES = {
  DIGIT_WIDTH: 9,
  BALANCE_START_X: 120,
}

const localedTetherBalance = computed(() => $app.filters.rounded(totalBalance.tether))
const localedSatoshiBalance = computed(() => $app.filters.rounded(totalBalance.satoshi))

const tetherBalanceLength = computed(
  () => TETHER_PROPERTIES.BALANCE_START_X - localedTetherBalance.value.length * TETHER_PROPERTIES.DIGIT_WIDTH,
)

const satoshiBalanceLength = computed(
  () => SATOSHI_PROPERTIES.BALANCE_START_X - localedSatoshiBalance.value.length * SATOSHI_PROPERTIES.DIGIT_WIDTH,
)

const INCREASE_STEP = 150
function countBalance(coin: TCoin) {
  totalBalance[coin] = totalBalance[coin] + INCREASE_STEP
}

onUnmounted(() => {
  crossfadeAnimation.value?.kill()
})
</script>

